import React from 'react';
import 'bulma/css/bulma.css';
import Navbar from './Navbar.js'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {Navbar}
      </header>
    </div>
  );
}

export default App;
